import React, {Component} from 'react';

const TITLES = [
    'Software Engineer',
    'Sports Person',
    'Wandrer',
    'Adventure seeker'
];

class Title extends Component {
    state = {titleIndex: 0};
    render(){
        const title = TITLES[this.state.titleIndex];
        return(
            <p>I am {title}</p>
        )
    }
}

export default Title;
